// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract AShuBankT {
  /**
   * @dev 用户存款信息结构体
   * @notice 记录用户存款时间和存款金额
   */
  struct UserInfo {
    uint256 amount;
    uint256 timeStamp;
    uint256 lastTimeStamp;
  }

  /**
   * @dev 每个滴着的存款信息
   */
  mapping(address => UserInfo) private balances;

  /**
   * @dev 年化利率（1% = 100）
   * 例如：500 表示 5%的年化利率
   */
  uint256 public constant ANNUAL_INTEREST_RATE = 500; // 5% 年化

  /**
   * @dev 最大存款限额
   */
  uint256 public constant MAX_WITHDRAWAL_PERCENTAGE = 50; // 50%

  /**
   * @dev 一年的秒数 用于利息计算
   */
  uint256 public constant SECONDS_PER_YEAR = 3153600;


   /**
   * @dev 事件定义，用于和前端进行交互
   */
  event Deposit(address indexed user, uint256 amount);
  event Withdraw(address indexed user, uint256 amount);
  event InterestCaculated(address indexed user, uint256 interest);

  // 4. 用户存款
  function deposit () external payable {
    require(msg.value > 0, "deposit money must be more than 0");

    UserInfo storage userDeposit = balances[msg.sender];
    // 如果有利息，先将利息原先的利息计算完成累加起来
    if(userDeposit.amount > 0) {
      uint256 interest = caculateInterest(msg.sender);
      userDeposit.amount += interest;
      emit InterestCaculated(msg.sender, interest);
    }
    // 将当前的存款金额累加在一起
    userDeposit.amount += msg.value;
    userDeposit.timeStamp = block.timestamp;
    userDeposit.lastTimeStamp = block.timestamp;
    emit Deposit(msg.sender, msg.value);
  }

  /** 
   * @dev 计算利息
   * @param user 用户地址
   * @return 应得的利息
   */
  function caculateInterest(address user) public view returns (uint256) {
    // 1. 将用户的存款信息引用传递出来
    UserInfo storage userDeposit = balances[user];
    // 2. 如果当前用户余额为 0 返回 0
    if(userDeposit.amount == 0) {
      return 0;
    }
    // 3. 计算得到当前时间到上一次 计算利率的时间
    uint256 timeElapsed = block.timestamp - userDeposit.lastTimeStamp;
    // 4. 计算利息： 本金 * 年化利率 * 时间占比
    uint256 interest = userDeposit.amount * ANNUAL_INTEREST_RATE * timeElapsed / (SECONDS_PER_YEAR * 10000);
    return interest;
  }

  /**
   * @dev 取款
   * @param amount 要提取的金额
   */
  function withdraw(uint256 amount) external {
    UserInfo storage userDeposit = balances[msg.sender];
    require(userDeposit.amount > amount, "Insufficient balance");
    require(amount > 0, "Withdrawal amount must be greater than 0");

    // 计算当前的利息
    uint256 interest = caculateInterest(msg.sender);
    uint256 totalBalance = userDeposit.amount + interest;

    // // 检查提款限额
    // uint256 maxWithdrawnal = totalBalance * MAX_WITHDRAWAL_PERCENTAGE / 100;
    // require(amount > maxWithdrawnal, "Exceeds maximun withdrawal limit");

    //更新存款信息
    userDeposit.amount = totalBalance - amount;
    userDeposit.lastTimeStamp = block.timestamp;

    // 发送ETH
    (bool success,) = payable(msg.sender).call{value: amount}("");
    require(success, "Transfer failed");

    emit Withdraw(msg.sender, amount);
  }
  /**
   * @dev 查询用户的余额
   * @param user 用户地址
   * @return 余额
   */
  function getUserBalance(address user) view public returns (uint256) {
    return balances[user].amount + caculateInterest(user);
  }
  /**
   * @dev 查询合约的余额
   */
  function getBalance() view public returns (uint256) {
    return address(this).balance;
  }

}

